import logo from "./logo.svg";
import "./App.css";
import { Component } from "react";
import "./App.scss";

class App extends Component {
  render() {
    const appHeader = (
      <header className="App-header">
        <div className="container-img-name">
          <img src={logo} className="App-logo" alt="logo" />
          <div className="name-and-date">
            <p>Liliana Mendoza</p>
            <p>Lunes 26 de junio de 2017</p>
          </div>
        </div>
      </header>
    );
    const appParagraph = (
      <p className="paragraph">
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Earum animi
        accusamus et, minus asperiores sunt veniam obcaecati ipsam autem velit
        eaque est provident voluptas dolores error cum doloremque nesciunt a?
      </p>
    );

    const appRoot = (
      <div className="App">
        {appHeader} {appParagraph}
      </div>
    );
    return appRoot;
  }
}

export default App;
